INSERT INTO `posts` (`id`, `title`, `description`, `user_id`, `category_id`, `is_publish`, `ordering`, `created_at`) VALUES
(1, 'စားရင်းသောက်ရင်း ဝိတ်ကျချင်လား', '&lt;p&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; style=&quot;width: 669.547px;&quot; data-filename=&quot;eat.jpg&quot;&gt;&lt;/p&gt;&lt;p&gt;ဝိတ်ကျစေမယ့် အစားအသောက်လို့ ပြောလိုက်ရင် လူတိုင်းမျက်လုံးတွေအရောင်တောက်လာတတ်ကြပါတယ်။ အမှန်ပါပဲ။ စားလည်းစားရမယ် ဝိတ်လည်းမတက်တဲ့အပြင် ကျလည်းကျဦးမယ်ဆိုတော့ သားရွှေအိုးထမ်းလာတာ မြင်ရတယ်ဆိုတာမျိုးပဲကိုး။&lt;br style=&quot;box-sizing: inherit;&quot;&gt;ဒါပေမဲ့ ဝမ်းနည်းစွာနဲ့ပဲ သိထားသင့်တဲ့ အမှန်တရားတစ်ခုကတော့ ဘယ်အစားအသောက်မှ စားသောက်လိုက်ရုံနဲ့ ကျန်းမာဘေးကင်းစွာ ကိုယ်လိုချင်တဲ့ ကိုယ်အလေးချိန်ပမာဏအထိ ကျသွားစေမှာမဟုတ်ဘူး ဆိုတာပါပဲ။တက်ဖို့လွယ်သလောက် ပြန်ချဖို့ ခက်ခဲလွန်းတဲ့ အရာတွေစာရင်းပြုစုရင် &lsquo;ကိုယ်အလေးချိန်&rsquo; ဆိုတာ ကမ္ဘာတည်သ၍ စာရင်းထိပ်မှာ ရှိမယ့်အရာတစ်ခုပါ။&lt;br style=&quot;box-sizing: inherit;&quot;&gt;ဒီတော့ ဝိတ်ချမယ်လို့ တွေးလိုက်ရင် ဝိတ်ဘာလို့တက်လာလဲဆိုတဲ့ အခြေခံအကြောင်းရင်းကို မသိမဖြစ် အရင်သိဖို့လိုပါမယ်။&lt;br style=&quot;box-sizing: inherit;&quot;&gt;&lt;span style=&quot;box-sizing: inherit; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;ဘာလို့ ကျွန်တော်တို့တွေ ဝလာကြတာလဲ&lt;/span&gt;&lt;br style=&quot;box-sizing: inherit;&quot;&gt;ဆာလောင်လွယ်လွန်းတဲ့ ဝမ်းဗိုက်လေးတွေနဲ့ အရသာခံတတ်လွန်းတဲ့ လျှာလေးတွေပိုင်ဆိုင်ထားတဲ့ ကျွန်တော်တို့လူသားတွေဟာ အသက်ကြီးလာလေ လှုပ်ရှားမှုနည်းလာလေ ဖြစ်ပါတယ်။ လှုပ်ရှားချင်စိတ်လည်းနည်းလာသလို ကိုယ်လက်လှုပ်ရှားမှုပြုလုပ်ဖို့ အခြေအနေ အချိန်အခါ အခွင့်အလမ်းတွေလည်း နည်းပါးလာလေဖြစ်ပါတယ်။&lt;br style=&quot;box-sizing: inherit;&quot;&gt;ဒီအခါမှာ မသုံးဖြစ်လို့ ပိုနေတဲ့ နေ့စဉ်စားသောက်ခဲ့သမျှ စွမ်းအင် ကယ်လိုရီတွေ စုပုံလာရင်းက ကိုယ်အလေးချိန်တွေတက်လာပြီး ကျွန်တော်တို့တွေဟာ ဝဝတုတ်တုတ် ဖိုးဝရုပ်လေးတွေ ဖြစ်လာကြရပါတယ်။&lt;br style=&quot;box-sizing: inherit;&quot;&gt;အထက်မှာ ကျွန်တော်ပြောခဲ့သလိုပဲ ဘယ်အစားအသောက်လေး စားလိုက်လို့ ကျန်းမာပျော်ရွှင်စွာ ဝိတ်ထိုးကျသွားတယ်ဆိုတာမျိုးကတော့ မရှိနိုင်ပေမဲ့ ဝိတ်မြန်မြန်ကျဖို့ ကူညီပေးနိုင်တဲ့ အစားအသောက်တွေကတော့ တကယ်ရှိပါတယ်။&lt;br style=&quot;box-sizing: inherit;&quot;&gt;ဒီအစားအသောက်တွေမှာ ခဏခဏ ဗိုက်ဗိုက်ဆာတတ်တဲ့ လူတွေကို လွယ်လွယ်နဲ့ မဆာလောင်စေနိုင်အောင် ကူညီပေးနိုင်တဲ့ အစားအသောက်တွေပါသလို ဗိုက်ပြည့်အောင်စားလိုက်ပေမယ့် ဝိတ်မတက်စေတဲ့ ပျော်ပျော်ရွှင်ရွှင်စားသောက်ရင်း ဝိတ်ချလို့ရတဲ့ အစားအသောက်တွေလည်းပါပါတယ်။&lt;br style=&quot;box-sizing: inherit;&quot;&gt;ဒီအစားအသောက်တွေရဲ့ အကူအညီနဲ့ Calorie Intake လို့ခေါ်တဲ့ ကယ်လိုရီစွမ်းအင် အဝင်ပမာဏကို လျှော့ချရင်း တစ်ဖက်က နေ့စဉ်ကိုယ်လက်လှုပ်ရှားမှု လေ့ကျင့်ခန်းတစ်ခုခုနဲ့ ကယ်လိုရီတွေ တကယ်လောင်ကျွမ်းစေမယ်ဆိုရင် ဝိတ်မကျစရာအကြောင်းမရှိပါဘူးလို့ ကျွန်တော်အာမခံပါတယ်။နည်းနည်းလေးပါဆိုပြီး ချိုချိုရဲရဲ ဆီရွှဲရွှဲလေးတွေ &hellip; သာသာယာယာ ယမကာလေးတွေ တိတ်တိတ်လေး မစားသောက်မိစေဖို့တော့ လိုတာပေါ့နော်။&lt;br style=&quot;box-sizing: inherit;&quot;&gt;ကဲ.. လွယ်လွယ်ကူကူ ဘာတွေစားလို့ရမလဲ ကြည့်လိုက်ရအောင်။&lt;br style=&quot;box-sizing: inherit;&quot;&gt;အလွယ်မှတ်ဖို့ဆိုရင်တော့&lt;br style=&quot;box-sizing: inherit;&quot;&gt;၁။ အသား/ငါး/ပဲ&lt;br style=&quot;box-sizing: inherit;&quot;&gt;၂။ အသီးအရွက်&lt;br style=&quot;box-sizing: inherit;&quot;&gt;၃။ အသီးအနှံ&lt;br style=&quot;box-sizing: inherit;&quot;&gt;၄။ အစေ့အဆန် ရယ်လို့ မှတ်ထားပါ။&lt;br&gt;&lt;/p&gt;', 2, 6, '0', NULL, '2022-03-20 17:13:47');
INSERT INTO `posts` (`id`, `title`, `description`, `user_id`, `category_id`, `is_publish`, `ordering`, `created_at`) VALUES
(2, 'လူထုအကျိုးပြုလုပ်ငန်းတွေမှာ တက်ကြွစွာ ပါဝင်လျက်ရှိတဲ့ Samsung ရဲ့ CSR Programs များအကြောင်း', '&lt;p&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; style=&quot;width: 669.547px;&quot; data-filename=&quot;samsungdaily.jpg&quot;&gt;&lt;/p&gt;&lt;p style=&quot;box-sizing: inherit; margin-bottom: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6em; vertical-align: baseline; grid-column: main-start / main-end;&quot;&gt;နည်းပညာလောကမှာလူသိများပြီး စမတ်ဖုန်းစျေးကွက်ကို ဆယ်စုနှစ်တစ်ခုကျော် လွှမ်းမိုးထားနိုင်တဲ့ Samsung Electronics အနေနဲ့ သူမတူတဲ့ နောက်ဆုံးပေါ် နည်းပညာတွေကို အမြဲတမ်းဆန်းသစ် တီထွင်နေတဲ့အပြင် တစ်ဖက်မှာလည်း ကမ္ဘာတဝန်းက ဈေးကွက်တွေမှာ လူထုအကျိုးပြုလုပ်ငန်းတွေတွေကို ထိထိရောက်&zwnj;ရောက် ကြိုးပမ်းဆောင်ရွက်နေတာ တွေ့ရပါတယ်။ နိုင်ငံတကာက Samsung company အသီးသီးက လူမှုအကျိုးပြုလုပ်ငန်းတွေကို လုပ်ဆောင်နေကြသလို မြန်မာနိုင်ငံကို ဝင်ရောက်လာတဲ့အချိန်ကစပြီး Samsung Myanmar မှလည်း မြန်မာနိုင်ငံက လူငယ်များ ဖွံ့ဖြိုးတိုးတက်ရေးအတွက် ပညာရေး၊ သက်မွေးပညာ၊ သင်ထောက်ကူပစ္စည်းများပံ့ပိုးပေးခြင်း စတဲ့ လူထုအကျိုးပြုလုပ်ငန်းများကို စဥ်ဆက်မပြတ် လုပ်ဆောင်ခဲ့တဲ့အကြောင်းတွေကို လေ့လာတွေ့ရှိခဲ့သမျှ မျှဝေပေးလိုက်ပါတယ်။&lt;/p&gt;&lt;p style=&quot;box-sizing: inherit; margin-top: 4vmin; margin-bottom: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6em; vertical-align: baseline; grid-column: main-start / main-end;&quot;&gt;&lt;span style=&quot;box-sizing: inherit; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;1. &amp;nbsp; &amp;nbsp; &amp;nbsp;Myanmar Mobile Education Project&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;box-sizing: inherit; margin-top: 4vmin; margin-bottom: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6em; vertical-align: baseline; grid-column: main-start / main-end;&quot;&gt;၂၀၁၅ ခုနှစ်မှ ၂၀၁၇ ခုနှစ်အတွင်း မြန်မာရွေ့လျားပညာ သင်ကြား ရေး myME နှင့် Samsung Myanmar နဲ့ လက်တွဲပြီး ရန်ကုန်နှင့် မန္တလေးက အကြောင်းအမျိုးမျိုးကြောင့် ပညာသင်ကြားရန်ခက်ခဲသော ကလေးပေါင်း ၃၀၀၀ ကျော်ကို &amp;nbsp;Myanmar Mobile Education project မှတဆင့် ကလေးအလုပ်သမားများကို စာသင်ခန်းထဲအရောက်ခေါ်နိုင်ခဲ့ပြီး Certificate များပေးအပ်နိုင်ခဲ့ပါတယ်။&lt;/p&gt;&lt;p style=&quot;box-sizing: inherit; margin-top: 4vmin; margin-bottom: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6em; vertical-align: baseline; grid-column: main-start / main-end;&quot;&gt;&lt;br&gt;&lt;/p&gt;', 2, 2, '0', NULL, '2022-03-20 17:15:13');
INSERT INTO `posts` (`id`, `title`, `description`, `user_id`, `category_id`, `is_publish`, `ordering`, `created_at`) VALUES
(3, 'Farmer&rsquo;s estate faces seizure over US$288k debt', '&lt;p&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; style=&quot;width: 480px;&quot; data-filename=&quot;e1.jpg&quot;&gt;&lt;/p&gt;&lt;p&gt;A TOBACCO farmer temporarily lost her estate after the High Court put it under provisional sequestration over failure to pay&amp;nbsp;&amp;nbsp;Zimbabwe Leaf Tobacco.&lt;br&gt;&lt;/p&gt;', 2, 2, '0', NULL, '2022-03-20 17:16:31'),
(5, 'Alarming copper pipe theft increase in Pietermaritzburg &ndash; security company', '&lt;p style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-bottom: 20px; line-height: 1.5;&quot;&gt;&ldquo;Mi7 National Group has noted an alarming increase in the rate of theft of copper piping from residential and business properties,&rdquo; the Mi7 National Group said.&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-bottom: 20px; line-height: 1.5;&quot;&gt;The company said it was evident by the number of cases attended to in the last two weeks by Mi7 armed response, where copper piping was stolen from client and non-client properties.&lt;/p&gt;&lt;p style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-bottom: 20px; line-height: 1.5;&quot;&gt;National Mi7 Group urged the community to be mindful of the spike and to take the following precautions:&lt;/p&gt;&lt;ol style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); list-style: none; margin-top: 20px; margin-bottom: 20px; margin-left: 20px; padding-left: 0px;&quot;&gt;&lt;li style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-left: 20px; padding-left: 10px; margin-bottom: 8px; list-style-type: decimal;&quot;&gt;Make sure you have effective perimeter security such as fences, walls, barbed wire, or electric fencing.&lt;/li&gt;&lt;li style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-left: 20px; padding-left: 10px; margin-bottom: 8px; list-style-type: decimal;&quot;&gt;Install CCTV surveillance systems to monitor yards and perimeters or install outdoor beams which trigger your alarm when motion is sensed.&lt;/li&gt;&lt;li style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-left: 20px; padding-left: 10px; margin-bottom: 8px; list-style-type: decimal;&quot;&gt;Copper pipes can be disguised. For example, painting them black or green may give the appearance of plastic from afar.&lt;/li&gt;&lt;li style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-left: 20px; padding-left: 10px; margin-bottom: 8px; list-style-type: decimal;&quot;&gt;Ensure your yard is well lit.&lt;/li&gt;&lt;li style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-left: 20px; padding-left: 10px; list-style-type: decimal;&quot;&gt;Ensure your yard is clear of debris which can provide cover for would-be criminals.&lt;/li&gt;&lt;/ol&gt;&lt;p style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-bottom: 20px; line-height: 1.5;&quot;&gt;&ldquo;It is also important to report any scrap metal outlet which purchases suspected stolen copper material,&rdquo; the Mi7 National Group said.&lt;/p&gt;', 4, 2, '0', NULL, '2022-03-20 17:18:48');
INSERT INTO `posts` (`id`, `title`, `description`, `user_id`, `category_id`, `is_publish`, `ordering`, `created_at`) VALUES
(6, 'မျိုးဆက်သစ်ခေါက်ချိုးဖုန်းတွေကိုအခုလ Galaxy Unpacked Event မှာမိတ်ဆက်လာနိုင်ခဲ့တဲ့ Samsung ရဲ့အောင်မြင်ခြင်းနောက်ကွယ်ကစိတ်ဝင်စားဖွယ်အချက်များ', '&lt;p&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; style=&quot;width: 669.547px;&quot; data-filename=&quot;3.jpg&quot;&gt;&lt;/p&gt;&lt;p style=&quot;box-sizing: inherit; margin-bottom: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6em; vertical-align: baseline; grid-column: main-start / main-end;&quot;&gt;&lt;span style=&quot;box-sizing: inherit; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;Samsung ရဲ့ Journey ကို ဘယ်လိုစတင်ခဲ့လဲ?&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;box-sizing: inherit; margin-top: 4vmin; margin-bottom: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6em; vertical-align: baseline; grid-column: main-start / main-end;&quot;&gt;Samsungလို့ ကမ္ဘာကျော်အမှတ်တံဆိပ် ဖြစ်ပေါ်လာခြင်းရဲ့ နောက်ကွယ်မှာ စိတ်ဝင်စားဖွယ်ကောင်းတာတွေ ရှိပါတယ်။ Samsungကို လျှပ်စစ်ပစ္စည်းနဲ့ စမတ်ဖုန်းထုတ်လုပ်တဲ့ကုမ္ပဏီရယ်လို့ လူမသိခင်မှာ Samsungဟာ ငါးခြောက်လုပ်ငန်းကနေ စတင်လုပ်ကိုင်ခဲ့တာပြီး အလုပ်သမား(၄၀)ခန့်နဲ့ Lee Byung-Cullက စတင် တည်ထောင်ခဲ့တာပဲဖြစ်ပါတယ်။ အလုပ်သမား(၄၀)နဲ့စတင်ခဲ့ပေမဲ့ 2019 ခုနှစ်မှတ်တမ်းတွေအရSamsung မှာ ကမ္ဘာနဲ့အဝှမ်းအလုပ်သမားပေါင်း နှစ်သိန်း&minus;ရှစ်သောင်းကျော် ရှိနေပါပြီ။ ငါးခြောက်လုပ်ငန်းမှာပဲ ရပ်မနေပဲ အထည်အလိပ်လုပ်ငန်းတွေ၊ Heavy industriesတွေနဲ့ Samsung shipbuildingတွေကနေစပြီး ကုမ္ပဏီအခွဲတွေတည်ထောင်ခဲ့ပြီး ရေနံ,ဓာတုလုပ်ငန်းတွေကိုပါ တိုးချဲ့လုပ်ကိုင်ခဲ့ပါတယ်။ Samsungဟာ ကိုရီးယားစစ်ပွဲအပြီးမှာ တောင်ကိုရီးယာနိုင်ငံရဲ့ စီးပွားရေးပြန်လည်ဦးမော့လာအောင် ပါဝင်ကူညီခဲ့ပါတယ်။&lt;/p&gt;&lt;p style=&quot;box-sizing: inherit; margin-top: 4vmin; margin-bottom: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6em; vertical-align: baseline; grid-column: main-start / main-end;&quot;&gt;1980နှောင်းပိုင်းကာလတွေမှာတော့ Samsungဟာ telecommunication hardware လုပ်ငန်းထဲကို စတင်၀င်ရောက်ခဲ့ပြီး ပထမဆုံးထုတ်ကုန်တွေကတော့ switchboard တွေပဲဖြစ်ပါတယ်။ Samsung ထုတ်လုပ်ခဲ့တဲ့ Switchboardကတော့ ဒီနေ့ခေတ်Samsungဖုန်းတွေရဲ့ ဘိုးဘေးတွေဖြစ်ပြီး ကားမှာတစ်ခါတည်းတပ်ဆင်ထားတဲ့ ဖုန်းပြောနိုင်တဲ့စက်ဖြစ်ပါတယ်။အဲ့ဒီကမှတစ်ဆင့် တဖြည်းဖြည်းအဆင့်မြင့်တင်လာခဲ့ပြီး fax machine တွေနဲ့ telephoneတွေကိုပါ စတင်ထုတ်လုပ်ရောင်းချလာခဲ့ပြီး Samsung ရဲ့ smartphone လုပ်ငန်းတွေကို အစပျိုးခဲ့ပါတယ်။&lt;/p&gt;', 4, 3, '0', NULL, '2022-03-20 17:19:27');
INSERT INTO `posts` (`id`, `title`, `description`, `user_id`, `category_id`, `is_publish`, `ordering`, `created_at`) VALUES
(7, 'အဆုတ်ကို သန့်စင်ပေးနိုင်တဲ့အစားအစာတွေကဘာတွေဖြစ်မလဲ', '&lt;p&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; style=&quot;width: 669.547px;&quot; data-filename=&quot;4.jpg&quot;&gt;&lt;/p&gt;&lt;p&gt;အခုလိုအချိန်မျိုးမှာ အာဟာရပြည့်ဝအောင်စားပေးဖို့လိုအပ်သလို အဆုတ်ကိုအဓိက အားကောင်းအောင်လည်းလိုအပ်ပါတယ်။ ကျန်းမာရေးနဲ့ညီညွတ်တဲ့အစားအသောက်တွေကို စားပေးခြင်းကခန္ဓာကိုယ်မှာရှိတဲ့ကိုယ်ခံအားကိုလည်းအထူးဂရုစိုက်ရာရောက်ပါတယ်နော်။ အဆုတ်ကိုအားကောင်းစေပြီး သန့်စင်ပေးနိုင်တဲ့ အစားစာတွေကိုတော့တစ်နေ့တာရဲ့ ဖြည့်စွက်အစာတစ်ခုအနေနဲဲ့စားပေးဖို့လိုအပ်ပါတယ်။&lt;br style=&quot;box-sizing: inherit;&quot;&gt;&lt;span style=&quot;box-sizing: inherit; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;ပန်းသီး&lt;/span&gt;&lt;br style=&quot;box-sizing: inherit;&quot;&gt;ပန်းသီးကမြန်မာလူမျိုးတွေအတွက် အသင့်တော်ဆုံးအသီးတစ်မျိုးလည်းဖြစ်သလို အလွယ်တကူ၀ယ်ယူလို့ရတဲ့အသီးတစ်မျိုးပါ။အမျှင်ဓာတ်နဲ့ Vitamin ဓာတ်တွေပါ၀င်တဲ့အတွက်အဆုတ်ကိုအားကောင်းစေပြီး သန့်စင်ပေးနိုင်တဲ့အသီးတစ်မျိုးဖြစ်ပါတယ်။ဆရာ၀န်တွေရဲ့ပြောကြားချက်အရ အခုလိုအချိန်မျိုးမှာ တစ်နေ့တစ်လုံးစားပေးသင့်ပါတယ်။&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;data:image/png;base64,&quot; style=&quot;width: 669.547px;&quot; data-filename=&quot;5.png&quot;&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', 4, 4, '0', NULL, '2022-03-20 17:22:22');
INSERT INTO `posts` (`id`, `title`, `description`, `user_id`, `category_id`, `is_publish`, `ordering`, `created_at`) VALUES
(8, 'Investec launches Programmable Banking for businesses and private clients', '&lt;p style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-bottom: 20px; line-height: 1.3;&quot;&gt;In a local industry first, Investec has launched Programmable Banking for business and private clients.&lt;/p&gt;&lt;p style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-bottom: 20px; line-height: 1.5;&quot;&gt;This new programme offers clients access to their banking and transactional data along with the power to create individualised banking services.&lt;/p&gt;&lt;p style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-bottom: 20px; line-height: 1.5;&quot;&gt;Due to the rapidly evolving digital era, users want more control over their digital experiences.&lt;/p&gt;&lt;p style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-bottom: 20px; line-height: 1.5;&quot;&gt;Programme head of Investec business online and API (application programming interface) banking, Devina Maharaj, said the mission of Programmable Banking is to accelerate digital-led innovation and offer an out-of-the-ordinary experience to business and private banking.&lt;/p&gt;&lt;p style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-bottom: 20px; line-height: 1.5;&quot;&gt;&ldquo;Tech has become an integral part of all industries, including the finance sector, and virtually every industry needs developers to keep pace with technological advancements and innovation,&rdquo; said Maharaj.&lt;/p&gt;', 3, 5, '0', NULL, '2022-03-20 17:23:35');
INSERT INTO `posts` (`id`, `title`, `description`, `user_id`, `category_id`, `is_publish`, `ordering`, `created_at`) VALUES
(9, 'Reimagine, Repurpose and Rediscover your love for libraries during SA Library week', '&lt;p style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-bottom: 20px; line-height: 1.3;&quot;&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; style=&quot;width: 669.547px;&quot; data-filename=&quot;user5.jpg&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-bottom: 20px; line-height: 1.3;&quot;&gt;The Library and Information Association (LIASA) celebrates South African Library Week (SALW) for the 20th time, and this year&rsquo;s theme is Reimagine, Repurpose, and Rediscover...Libraries.&lt;/p&gt;&lt;p style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-bottom: 20px; line-height: 1.5;&quot;&gt;The South African Library week will take place from March 14 to 20, 2022.&lt;/p&gt;&lt;p style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-bottom: 20px; line-height: 1.5;&quot;&gt;Covid-19 has upended everything and libraries are no exception. The very nature of what libraries are and do has been impacted, and we are forced to re-evaluate not only our services and how we deliver them to our user communities but also the manner in which libraries will operate in the future.&lt;/p&gt;&lt;p style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-bottom: 20px; line-height: 1.5;&quot;&gt;Despite this upheaval, many libraries have managed to operate in novel ways in order to remain present and relevant in the lives of their user communities. From online storytelling to remote access to databases and from kerbside pickups to online programming &ndash; many libraries have managed to continue providing a service to their communities. However, there are many libraries and information services that still grapple with providing appropriate services or are sometimes even unable to provide these in any meaningful way. Sub-sectors of the Library and Information Services (LIS) community have also responded differently and this continues to be a cause for concern.&lt;/p&gt;&lt;p style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-bottom: 20px; line-height: 1.5;&quot;&gt;After reflecting on the changes wrought on the services and hence the library and/or information services profession, LIASA urges everyone in the Library and Information Services sector to Reimagine and Repurpose libraries so that communities will rediscover them.&lt;/p&gt;', 3, 5, '0', NULL, '2022-03-20 17:24:43');
INSERT INTO `posts` (`id`, `title`, `description`, `user_id`, `category_id`, `is_publish`, `ordering`, `created_at`) VALUES
(10, 'How to talk to teens about nude photos and online safety', '&lt;div style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5);&quot;&gt;&lt;p style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-bottom: 20px; line-height: 1.3;&quot;&gt;During months or even years of remote schooling, teenagers turned to technology to keep their social lives humming. And whether parents knew it, they used it to explore their sexualities, too.&lt;/p&gt;&lt;p style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-bottom: 20px; line-height: 1.5;&quot;&gt;Preliminary research suggests that teens sexted or sent sexually explicit images, videos or messages electronically more than ever during the pandemic, according to family advocacy organization Common Sense Media. Now, teens are coming back to the classroom and confronting head-on the risks and rewards of a romantic life lived online. A survey of sexting research in the Journal of the American Medical Association back in 2018 found that a quarter of teens had received a sext, while about 15% had sent one. Since then, definitive research has been sparse, but experts say sexting is probably on the rise since teens got confined to their homes.&lt;/p&gt;&lt;p style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-bottom: 20px; line-height: 1.5;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-bottom: 20px; line-height: 1.5;&quot;&gt;The desire to see and send photos of naked bodies is totally normal, said Devorah Heitner, the founder of family advocacy organization Raising Digital Natives. Teens are no exception, but they are particularly vulnerable to the dangers that come with sharing or receiving sensitive images. Once a teen hits &quot;send,&quot; it&#039;s tough to control where the sext ends up, whether that&#039;s in the hands of cruel classmates or strangers online.&lt;/p&gt;&lt;p style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-bottom: 20px; line-height: 1.5;&quot;&gt;Teens&#039; growing reliance on social media exposes them to more predators: From 2019 to 2020, reports of adults enticing minors online doubled to about 38,000 from 19,000, according to data from the National Center for Missing and Exploited Children. Sexts could lead to cyberbullying, privacy violations and blackmailing, experts say. And the social stigma of sexting often leads communities to punish victims of sexting violations more harshly than offenders while insufficient sex education leaves teens confused about consent.&lt;/p&gt;&lt;p style=&quot;border-width: 0px; border-style: solid; border-color: currentcolor; --x-ring-color:rgba(59,130,246,0.5); margin-bottom: 20px; line-height: 1.5;&quot;&gt;&quot;I don&#039;t suggest locking up a 13-year-old the first time they experiment with this behavior, but there has to be a way to respond, especially for middle school kids who got so impaired by the pandemic in their social development the last few years,&quot; Heitner said.&lt;/p&gt;&lt;/div&gt;', 3, 3, '0', NULL, '2022-03-20 17:26:04');
INSERT INTO `posts` (`id`, `title`, `description`, `user_id`, `category_id`, `is_publish`, `ordering`, `created_at`) VALUES
(11, 'Viber မှ Group Chat များအတွင်း မက်ဆေ့ချ်များ အလိုအလျောက် ပျောက်ကွယ်စေသည့် စနစ်အား ထည့်သွင်း', '&lt;p&gt;&lt;img src=&quot;data:image/png;base64,&quot; style=&quot;width: 100%;&quot; data-filename=&quot;7.png&quot;&gt;&lt;/p&gt;&lt;p style=&quot;box-sizing: inherit; margin-bottom: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6em; vertical-align: baseline; grid-column: main-start / main-end;&quot;&gt;Google Play ၌ ကမ္ဘာတစ်ဝှမ်းမှ ဒေါင်းလုပ်ပြုလုပ်မှု သန်းတစ်ထောင်ရောက်အထိ ရောက်ရှိခဲ့သော ကမ္ဘာ့ထိပ်တန်း စာတိုပို့ဆောင်ရေး ဝန်ဆောင်မှုတစ်ခုဖြစ်သည့် Rakuten Viber သည် ယခင်က တစ်ဦးချင်းဆက်သွယ်ပြောဆိုမှုတွင်သာ အသုံးပြုနိုင်ခဲ့သော မက်ဆေ့ချ်များ အလိုအလျောက် ပျောက်ကွယ်အောင် ဆောင်ရွက်နိုင်သည့် လုပ်ဆောင်ချက်အား အဖွဲ့လိုက်ဆက်သွယ်ပြောဆိုခြင်း (Group Chat) တွင်ပါ အသုံးပြုနိုင်အောင် ထည့်သွင်းပေးခဲ့ပါသည်။&lt;/p&gt;&lt;p style=&quot;box-sizing: inherit; margin-top: 4vmin; margin-bottom: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6em; vertical-align: baseline; grid-column: main-start / main-end;&quot;&gt;လက်ရှိအခြေအနေအရ မြန်မာနိုင်ငံသားများအတွက် လုံခြုံစိတ်ချမှုရှိခြင်းသည် အရေးကြီးဆုံးအရာ ဖြစ်သောကြောင့် Viber ၏ မက်ဆေ့ချ်များ အလိုအလျောက် ပျောက်ကွယ်စေသည့် စနစ်သည် အသုံးအများဆုံး ဖြစ်လာမည်ဟု မှန်းဆထားသည်။ မက်ဆေ့ချ်များ အလိုအလျောက် ပျောက်ကွယ်စေသည့် လုပ်ဆောင်ချက်အား Group Chat တွင် ထည့်သွင်းရန်အတွက် အသုံးပြုသူများသည် setting ထဲသို့ဝင်၍ လွယ်ကူ ရိုးရှင်းစွာပင် ဆောင်ရွက်နိုင်ပါသည်။ ထို့အပြင် အဆိုပါလုပ်ဆောင်ချက် အဖွင့်အပိတ်အား အဖွဲ့ဝင် Group members များ အနေဖြင့်လည်း ဝင်ရောက်ထိန်းချုပ်ပြောင်းလဲနိုင်မည်ဖြစ်သည်။&lt;/p&gt;', 3, 5, '0', NULL, '2022-03-20 17:27:41');
INSERT INTO `posts` (`id`, `title`, `description`, `user_id`, `category_id`, `is_publish`, `ordering`, `created_at`) VALUES
(12, 'ကိုယ်ခန္ဓာအတွက် ပရိုတိန်းဓာတ်ပြည့်ဝအောင်ဘာတွေစားပေးသင့်လဲ', '&lt;p&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; style=&quot;width: 669.547px;&quot; data-filename=&quot;8.jpg&quot;&gt;&lt;/p&gt;&lt;p&gt;ကိုယ်ခံအားကောင်းပြီး ကျန်းမာတဲ့သူတစ်ယောက်ဖြစ်ဖို့ဆိုရင် အစအစအရာရာဂရုစိုက်ဖို့အရမ်းအရေးပါပါတယ်။ အစားအသောက်နေထိုင်မှုပုံစံတွေပါ ပြောင်းလဲရပါမယ်။ မြန်မာအစားအသောက်တွေတော်တော်များများက အဆီအဆိတ်တွေများပါတယ်။ အဆီတွေကလည်း ခန္ဓာကိုယ်မှာများလာတဲ့အခါမှာ ရောဂါတစ်ခုအနေနဲ့ဖြစ်ပေါ်လာတတ်ပြီး မလိုလာအပ်တဲ့အခြေအနေမျိုးတွေဖြစ်ပေါ်လာတတ်ပါတယ်။ခန္ဓာကိုယ် အတွက်ကိုယ်ခံအားကောင်းပြီးတစ်နေတာလုံးမှာမပါမဖြစ်စားပေးသင့်တဲ့ အစားအသောက် ၅ မျိုးကိုပြောပြချင်ပါတယ်။&lt;br style=&quot;box-sizing: inherit;&quot;&gt;&lt;span style=&quot;box-sizing: inherit; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;ငါး&lt;/span&gt;&lt;br style=&quot;box-sizing: inherit;&quot;&gt;ငါးကိုတော့ တစ်ပတ်ကိုအနည်းဆုံးနှစ်ကြိမ်လောက်စားပေးသင့်ပါတယ်။ Omega-3 ဓာတ်တွေပါဝင်တဲ့အတွက် အာဟာရပညာရှင်များကလည်း မှတ်ဉာဏ်အားကောင်းစေပါတယ်။ သွေးလည်ပတ်မှုအားကိုလည်းအထူးကောင်းမွန်စေတဲ့အတွက် သွေးအားနည်းတဲ့သူတွေအနေနဲ့စားကိုစားပေးသင့်ပါတယ်။&lt;br&gt;&lt;/p&gt;', 3, 4, '0', NULL, '2022-03-20 17:28:30');
INSERT INTO `posts` (`id`, `title`, `description`, `user_id`, `category_id`, `is_publish`, `ordering`, `created_at`) VALUES
(13, 'စိတ်ဝင်စားမှုတွေနဲ့ပြည့်နေတဲ့ Cruella ရုပ်ရှင်ကဘာကြောင့်ကြည့်သင့်လဲ', '&lt;p&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; style=&quot;width: 669.547px;&quot; data-filename=&quot;9.jpg&quot;&gt;&lt;/p&gt;&lt;p&gt;ဖက်ရှင်ချစ်သူ ဖက်ရှင်စိတ်ဝင်စားတဲ့သူတွေအတွက်ရော မဖြစ်မနေကြည့်သင့်တဲ့ဇာတ်ကားတစ်ကားလို့ပြောလို့ရတဲ့ Cruella ရုပ်ရှင်ဇာတ်လားက Mulan ကဲ့သို့ Disney တွေကလည်းပါဝင်ပါတယ်။ရုပ်ရှင်ရဲ့ကြာမြင့်ချိန်က ၂ နာရီနဲ့ ၁၅ မိနစ်လောက်ဆိုပေမယ့် ဇာတ်ကားတစ်ခုလုံးက အံသြစရာတွေနဲ့ပြည့်နေတဲ့အတွက်အချိန်ကုန်လို့ကုန်မှန်းတောင်မသိလိုက်ပါဘူး။ဒါ့အပြင် Cruella ရုပ်ရှင်ရဲ့ ကာလာဖန်တီးပုံနဲ့ ဇာတ်လမ်းအသွားအလာတွေကလည်း လွမ်းဆွတ်စရာကောင်းတဲ့ အရာတစ်ခုအနေနဲ့ ရင်ထဲမှာကျန်ခဲ့ပါသေးတယ်။&lt;/p&gt;&lt;p&gt;Disney ရဲ့ဖန်တီးမှုတွေဖြစ်တဲ့ Wheelhouse, Dumbo and Beauty and the beast , Aladdin တို့လိုပဲ Cruella ကိုလည်း နှစ်လိုဖွယ်ကောင်းတဲ့ အရာတွေနဲ့ စီးပွါးရေးအလားလားကိုအကျိုးသက်ရောက်ဖို့မျှော်လင့်နေကြပါတယ်။၁၉၈၀ ခုနှစ်ကဖက်ရှင်အယူအဆကိုအခြေခံရိုက်ကူးထားပြီး Cruella ဆိုတဲ့သူဌေးမဘယ်လိုဖြစ်ပေါ်လာခဲ့လဲဆိုတာမြင်တွေရမှာပါနော်။&lt;/p&gt;&lt;p&gt;ငယ်ငယ်က Disney ဇာတ်ကားထဲက ခွေးတွေကိုလိုက်နှောက်ယှက်နေတဲ့မယ်လီဖီဆန်းဂျိုးကိုမြင်ရင်မကြေမနေတွေဖြစ်ခဲ့ရပေမယ့် အခုတော့ အယ်မာကျောက်တုံးလေးကဝင်ပြီးနေရာယူလိုက်တော့ Live Action ဇာတ်ကားကောင်းလို့လည်းပြောလို့ရပါတယ်။ အဲ့ကြောင့် ဖက်ရှင်ချစ်တဲ့သူတစ်ယောက်အနေနဲ့ရော Disney ရဲ့ဖန်တစ်ယောက်အနေနဲ့ရောကြည့်ကိုကြည့်သင့်ပါတယ်။&lt;span style=&quot;color: rgb(53, 55, 58); font-family: Georgia, Times, serif; font-size: 21px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;color: rgb(53, 55, 58); font-family: Georgia, Times, serif; font-size: 21px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 3, 2, '0', NULL, '2022-03-20 17:29:35');
INSERT INTO `posts` (`id`, `title`, `description`, `user_id`, `category_id`, `is_publish`, `ordering`, `created_at`) VALUES
(14, 'အကြိမ်ကြိမ်ရှုးနိမ့်ခဲ့ပေမယ့် လက်မလျော့ဘဲ ကြိုးစားရင်း အောင်မြင်မှုရခဲ့သော ကျော်ကြားသူများ', '&lt;p&gt;&lt;span style=&quot;color: rgb(53, 55, 58); font-family: Georgia, Times, serif; font-size: 21px;&quot;&gt;ဟယ်ရီပေါ်တာဝတ္ထုကို ရေးခဲ့တဲ့ J.K Rowling ဟာ နာမည်ကြီးစာထုတ်ဝေသူတွေက သူရေးခဲ့တဲ့ ဝတ္ထုကို ထုတ်ဝေဖို ငြင်းပယ်ခြင်းကို ၁၂ ကြိမ်တောင် ခံခဲ့ရသူပါ။ ပထမစာအုပ်စရေးနေတုန်းမှာပဲ အမျိုးသားဖြစ်သူနဲ့ကွာရှင်းခဲ့ပြီး ငါးနှစ်အရွယ်ကလေးကို တစ်ဦးတည်း စောင့်ရှောက်ခဲ့ရပါတယ်။ အလုပ်လက်မဲ့လည်းဖြစ်သွားတဲ့အပြင် ငွေကြေးလည်း အတော်အဆင်မပြေဖြစ်ခဲ့ပြီး စိတ်ကျဝေဒနာကို ပြင်းထန်စွာခံစားခဲ့ရပါတယ်။ ဒါပေမယ့် အခက်အခဲလောကဓံတွေကြားက အရှုးမပေးဘဲ စာဆက်ရေးခဲ့ပါတယ်။ ထုတ်ဝေသူတွေဆီကို ပိုတဲ့အခါမှာလည်း အကြိမ်ကြိမ်ငြင်းဆန်ခြင်းခံရပြီး နောက်ဆုံး ၁၃ယောက်မြောက်က စာအုပ်ထုတ်ဝေဖို လက်ခံခဲ့သူကလည်း စာအုပ်ရောင်းရမှာမဟုတ်ဘူးလို ပြောခဲ့ပါတယ်။ တကယ်ထုတ်ဝေခဲ့ချိန်မှာတေ့ာ ကမ္ဘာတဝန်း အရောင်းရဆုံးစာအုပ်စီးရီးဖြစ်ခဲ့ပြီး ဘာသာစကားပေါင်း ၇၃ ခုထိတောင် ဘာသာပြန်ထုတ်ဝေခဲ့ရပါတယ်။ &amp;nbsp;စာအုပ်ကို မီလီယမ်နဲ့ ချီအောင် ရောင်းခဲ့ရပြီး ၂၀ ဘီလီယမ်ကျော်တောင် ရုပ်ရှင်ရိုက်ကူးခြင်းမှ ဝင်ငွေရရှိခဲ့ပါတယ်။&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 3, 2, '0', NULL, '2022-03-20 17:30:05');
INSERT INTO `posts` (`id`, `title`, `description`, `user_id`, `category_id`, `is_publish`, `ordering`, `created_at`) VALUES
(15, 'Dark Chocolate စားပေးခြင်းရဲ့ကောင်းကျိူးတွေ', '&lt;p&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; style=&quot;width: 669.547px;&quot; data-filename=&quot;10.jpg&quot;&gt;&lt;/p&gt;&lt;p&gt;မထင်ရလောက်အာဟာပြည့်ဝစေတဲ့ ချောကလက်အမည်းရောင်က ကျန်းမာရေးအတွက်ဘယ်လိုအကျိုးသက်ရောက်မှုရှိစေနိုင်လဲ? Cacao အပင်တစ်မျိုးမှပြုလုပ်ထားတဲ့ ကမ္ဘာအကောင်းဆုံးလို့တောင် ပြောလို့ရတဲ့ Antioxidants တွေကိုလည်းထုပ်ပေးနိုင်တဲ့ Dark Chocolate အကြောင်းပြောပြချင်ပါတယ်။ လေ့လာမှုတွေအရဆိုရင် သကြားဓာတ်လျော့နည်းတဲ့အတွက် နှလုံးရောဂါဖြစ်နိုင်ချေကိုလည်းလျော့နည်းစေပါတယ်။&lt;br style=&quot;box-sizing: inherit;&quot;&gt;အာဟာရသင့်တင်းမျှတခြင်း&lt;br style=&quot;box-sizing: inherit;&quot;&gt;အရည်အသွေးပြည့်ဝတဲ့ Dark Chocolate တွေကပါဝင်တဲ့ပိုတက်စီယမ်နှင့်ဆယ်လီယမ်ဓာတ်တွေကအဆီများကိုလျော့ချပေးနိုင်ပါတယ်။ Caffeine ဓာတ်ပါဝင်တဲ့အတွက်လည်း ခန္ဓာကိုယ်ကိုနိုးနိုးကြားကြားဖြစ်စေပါတယ်။ဒါပေမယ့် နေတိုင်းစားပေးသင့်တဲ့အစားစားထဲမှာတော့မပါပါဘူးနော်။&lt;/p&gt;&lt;p&gt;သွေးဖိအားကောင်းမွန်ခြင်း&lt;br style=&quot;box-sizing: inherit;&quot;&gt;နိုက်ထရစ်အောက်ဆိုဒ်ဓာတ်ပါဝင်တဲ့အတွက် သွေးလွှတ်ကြောကိုလှုံ့ဆော်ပေးနိုင်ပါတယ်။သွေးစီးဆင်းမှုအားကိုခုခံနိုင်တဲ့တဲ့အတွက် သွေးဖိအားကိုလည်းလျော့ချပေးနိုင်ပါတယ်။သွေးတိုးနေတဲ့အချိန်မျိုးဆိုရင် သွေးကျအောင်စားပေးသင့်ပါတယ်။&lt;br style=&quot;box-sizing: inherit;&quot;&gt;ဦးနှောက်ဉာဏ်ရည်ကောင်းမွန်စေခြင်း&lt;br style=&quot;box-sizing: inherit;&quot;&gt;Dark Chocolate က ဦးနှောက်ရဲ့လုပ်ဆောင်ချက်ကိုတိုးတက်ကောင်းမွန်စေပါတယ်။ သက်ကြီးရွယ်အိုတွေအတွက်လည်း သိမြင်နိုင်စွမ်းအားကိုတိုးတက်စေနိုင်ပါတယ်။Theobromine ကဦးနှောက်ရဲ့ မှတ်နိုင်စွမ်းအားကောင်းမွန်တဲ့အဓိကအရင်းအမြစ်လည်းပြောလို့ရပါတယ်။&lt;/p&gt;&lt;p&gt;နေလောင်ဒဏ်ကာကွယ်ခြင်း&lt;br style=&quot;box-sizing: inherit;&quot;&gt;လေ့လာရှင်တွေရဲ့သုံးသပ်ချက်တွေအရ Dark Chocolate မှာပါဝင်တဲ့ Flavonols ကနေရောင်ခြည်ဓာတ်မှအဓိကကာကွယ်ပေးနိုင်စွမ်းအားရှိပါတယ်။အရေးပြားနီရဲတာတွေကိုလည်း ကာကွယ်ပေးနိုင်တဲ့ Dark Chocolate စားသုံးမှုကအရင်ထက်နှစ်ဆတိုးတက်လာတာတွေရပါတယ်။&lt;span style=&quot;color: rgb(53, 55, 58); font-family: Georgia, Times, serif; font-size: 21px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;color: rgb(53, 55, 58); font-family: Georgia, Times, serif; font-size: 21px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 3, 6, '0', NULL, '2022-03-20 17:30:58');
INSERT INTO `posts` (`id`, `title`, `description`, `user_id`, `category_id`, `is_publish`, `ordering`, `created_at`) VALUES
(16, 'အကြောပြတ်အရာတွေကဘာကြောင့်ဖြစ်တာလဲ၊ဘယ်လိုကာကွယ်မလဲ?', '<p><img src=\"data:image/jpeg;base64,\" style=\"width: 669.547px;\" data-filename=\"11.jpg\"></p><p>အလှအပဆိုတာအရေပြားတစ်ထောက်စာ ဆိုပေမယ့် အသားအရေအပေါ်မှာ အကြောပြတ်ရာကြီးတွေ ရှိနေရင်လည်း ကိုယ့်ယုံကြည်မှုလျော့နည်းစေတယ်လေ။အကြောတွေပြတ်ခြင်းက အဝလွန်၍အကြောပြတ်ခြင်း၊ အားကစားလုပ်၍အကြောပြတ်ခြင်း၊ကိုယ်အလေးချိန် ရုတ်တရက်အတက်အကျရှိတဲ့သူတွေ၊ ကိုယ်ဝန်ဆောင်မိခင်တွေ၊ ရုတ်တရက် ကိုယ်ခန္ဓာထွားကျိုင်းလာတဲ့ ဆယ်ကျော်သက်တွေ၊ ပင်ကိုယ်မျိုးရိုးဗီဇရှိသူတွေမှာအများဆုံးဖြစ်တတ်ပါတယ်။အရေပြားအတွင်းမှာရှိတဲ့ ကော်လဂျင်ဓာတ်တွေ၊ ပရိုတိန်းဓာတ်တွေ အသစ်ပြန်ထွက်နိုင်စွမ်းမရှိပဲ အနီအရောင်အဆင်းကြောင်း အဖြူရောင်အဆင်းအကြောင်းများပေါ်လာတတ်ပါတယ်။</p><p>အဖြူရောင်အဆင်းအကြောင်းများပေါ်လာတတ်ပါတယ်။အဓိကအဖြစ်များတဲ့နေရာတွေက လက်မောင်း၊ ခြေသလုံး၊တင်ပါးနဲ့၊ ပေါင်ပေါ်တွေမှာအဖြစ်များတတ်ပါတယ်။ကိုယ်ဝန်ဆောင်မိခင်တွေဆိုရင်ဗိုက်ရဲ့အောက်ဘက်တွေမှာအဖြစ်များတတ်ပါတယ်။ပထမတော့အနီအရောင်စင်းကြောင်းဖြစ်မယ် ပြီးရင်အရောင်ပြောင်းမယ်နောက်ဆုံးကိုယ့်ရဲ့ပင်ကိုယ်အသားအရောင်နဲ့မတူတဲ့အတွန့်အတွန့်စင်းကြောင်းလေးတွေဖြစ်သွားတတ်ပါတယ်။<span style=\"color: rgb(53, 55, 58); font-family: Georgia, Times, serif; font-size: 21px;\"><br></span><br></p>', 3, 4, '0', NULL, '2022-03-23 02:58:20');
INSERT INTO `posts` (`id`, `title`, `description`, `user_id`, `category_id`, `is_publish`, `ordering`, `created_at`) VALUES
(17, 'အာဟာရပြည့်ဝတဲ့ မနက်စားဖြစ်ဖို့ဘယ်လိုမျိုးလေးတွေလုပ်စားမလဲ', '&lt;p&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; style=&quot;width: 100%;&quot; data-filename=&quot;12.jpg&quot;&gt;&lt;/p&gt;&lt;p&gt;မနက်စာဆိုတာက လူတစ်ယောက်ရဲ့ခန္ဓာကိုယ်အတွက်လိုအပ်တဲ့အာဟာရဖြည့်စွက်စာလို့လည်းပြောလို့ရပါတယ်။ တစ်ချို့လူတွေက မနက်စာကိုနေ့လည်စာနဲ့ပေါင်းစားတာမျိုးတွေလည်းလုပ်တတ်ကြပါတယ်။ တကယ်တော့ ဒါမျိုးကလုံးဝမလုပ်သင့်ပါဘူးနော် ။ မနက်ပိုင်းမှာခန္ဓာကိုယ်အတွက်လိုအပ်တဲ့ ကယ်ဆီယမ်ဓာတ်တွေကိုဖြည့်တင်းပေးဖို့လိုအပ်ပါတယ်။ အာဟာရပြည့်ဝပြီး အဆီအဆိတ်နည်းတဲ့ကျန်းမာရေးနဲ့လည်းညီညွတ်တဲ့ မနက်စာဖြစ်ဖို့အတွက် ဘယ်လိုအစားအသောက်တွေနဲ့လွယ်လွယ်ကူကူလုပ်စားလို့ရမလဲဆိုတာပြောပြပေးချင်ပါတယ်။&lt;br style=&quot;box-sizing: inherit;&quot;&gt;&lt;span style=&quot;box-sizing: inherit; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;​ထောပတ်သီးနဲ့ပေါင်မုန့်&lt;/span&gt;&lt;br style=&quot;box-sizing: inherit;&quot;&gt;ထောပတ်သီးမှာပါဝင်တဲ့ကောင်းကျိုးတွေက &amp;nbsp;ဆီးချိုသမားတွေအတွက်သွေးထိန်းပေးနိုင်တဲ့အတွက် မနက်ခင်းမှာ အစာအိမ်လမ်းကြောင်းကိုလည်းရှင်းပေးနိုင်တဲ့အတွက် မနက်ခင်းမှာစားပေးဖို့သင့်တော်ဆုံးအသီးတစ်မျိုးဖြစ်တယ်လို့ပြောလို့ရပါတယ်။ ပေါင်မုန့်မီးကင်လေးနဲ့တွဲဖက်ပြီးစားသုံးပေးလို့ရပါတယ် ။&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;box-sizing: inherit; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;ကြက်ဥပေါင်း&lt;/span&gt;&lt;br style=&quot;box-sizing: inherit;&quot;&gt;ကြက်ဥကိုအမျိူးမျိုးလုပ်စားလို့ရတဲ့အထဲကမှ လွယ်ကူပြီးတော့ လုပ်ရတာလည်းအရမ်းရိုးရှင်းတဲ့ကြက်ဥပေါင်းလေးကိုလည်းလုပ်စားပေးကြည့်သင့်ပါတယ်။ ပါဝင်တဲ့ပစ္စည်းတွေကလည်း ကြက်ဥနဲ့ဟင်းခတ်အမွေးအကြိုင်ရှိရုံနဲ့လုပ်စားလို့ရပါပြီ ။&lt;span style=&quot;color: rgb(53, 55, 58); font-family: Georgia, Times, serif; font-size: 21px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 3, 4, '0', NULL, '2022-03-24 09:39:55');
INSERT INTO `posts` (`id`, `title`, `description`, `user_id`, `category_id`, `is_publish`, `ordering`, `created_at`) VALUES
(18, 'အလုပ်မှာ အမှားနည်းနိုင်သမျှနည်းပြီး အလုပ်တွေမြန်မြန်ပြီးစေဖို့', '&lt;p&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; style=&quot;width: 100%;&quot; data-filename=&quot;14.jpg&quot;&gt;&lt;/p&gt;&lt;p style=&quot;box-sizing: inherit; margin-bottom: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6em; vertical-align: baseline; grid-column: main-start / main-end;&quot;&gt;Multitask ဆိုတဲ့ အလုပ်ကိုတစ်ချိန်တည်းမှာ စွယ်စုံလုပ်နေတာမျိုးရှောင်ပါ။&lt;br style=&quot;box-sizing: inherit;&quot;&gt;လုပ်ငန်းခွင်နဲ့ပတ်သတ်ပြီး စစ်တမ်းကောက်ယူတာမျိုးလုပ်တဲ့ ရလဒ်တော်တေ်ာများများမှာ Multitasking လုပ်ခြင်းရဲ့ အကျိုးမရှိမှုများကို တွေ့ရမှာပါ။ တစ်ချိန်တည်းမှာ မြန်မြန်ပြီးတယ်ဆိုပေမယ့် အာစုံစူးစိုက်မှုများတဲ့အတွက် မလိုလားအပ်တဲ့အမှားတွေ လုပ်မိမှာပါ။ အရာအားလုံးကို တစ်ချိန်တည်းမှာအကုန်ပြီးေအောင် လောဘတကြီးလုပ်တာမျိုးမဟုတ်ဘဲ တစ်နေ့တာအတွင်းမှာ ဘယ်အလုပ်ကိုတော့ ဘယ်အချိန်ပြီးအောင်လုပ်မယ်ဆိုတာမျိုးကို သေချာ စီစဉ်ထားတာပိုကောင်းပါတယ်။&lt;/p&gt;&lt;p style=&quot;box-sizing: inherit; margin-top: 4vmin; margin-bottom: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6em; vertical-align: baseline; grid-column: main-start / main-end;&quot;&gt;အာရုံလွဲစေတဲ့အရာတွေကို တတ်နိုင်သလောက်မလုပ်မိအောင် မရှိအောင်ရှောင်ပါ&lt;/p&gt;&lt;p style=&quot;box-sizing: inherit; margin-top: 4vmin; margin-bottom: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.6em; vertical-align: baseline; grid-column: main-start / main-end;&quot;&gt;ဥပမာ- ဖုန်းကနေ Social media ဖွင့်ထားလို့ Noti တွေတက်လာတာမျိုး၊ Silence မလုပ်ထားမိလို့ မလိုတဲ့ ဖုန်းအဝင်တွေဝင်လာတာမျိုး၊ ကွန်ပြူတာမှာဆိုလည်း မလိုတဲ့ Notifications တွေဝင်လာတာမျိုး၊ လုပ်ငန်းခွင်မှာ အလုပ်တူတူလုပ်တဲ့သူတွေနဲ့ စကားတွေ ဖောင်ဖွဲ့ပြီး မကြာခန ပြောတာမျိုးတွေဖြစ်ပါတယ်။ ဒါလေးတွေက အသေးအဖွဲလို့ဆိုနိုင်ပေမယ့် အလုပ်ပြီးမြောက်ဖို့၊ အလုပ်ကို မှန်မှန်ကန်ကန် တိတိကျကျ လုပ်နိုင်ဖို့ အနှောင့်အယှက်ပေးနေတာဖြစ်ပါတယ်။&lt;/p&gt;', 3, 2, '0', NULL, '2022-03-24 09:41:29');

